import React from 'react'

const Confirm:React.FC = () =>{
    return (
        <div>
            <input type="textarea">
            </input>
            <button>送信</button>
            <div>電話番号：XXX-XXXX-XXXX</div>
            <div>メールアドレス：XXX-XXXX-XXXX</div>
        </div>
    )
}
export default Confirm
